## Answer (1)

You can use the `style` property of the `Container` to change the background color of an adaptive card in Microsoft teams.

Here is an example:

```
{
    "type": "AdaptiveCard",
    "version": "1.0",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
